window.bookSummaryJSON = "<p>“There will be neither compassion nor mercy; <br>Nor peace, nor solace <br>For those who bear witness to these Signs<br>And still do not believe.\" <i>Book of Reclaiming 25:10</i> </p> <p>New Eden: the celestial battleground of a catastrophic war that has claimed countless lives. </p> <p>The immortal starship captains spearheading this epic conflict continue their unstoppable dominance, shaping the universe to their will and ensuring a bloody, everlasting stalemate. But a powerful empire is on the verge of a breakthrough that could end the war and secure their rule over mankind forever. For deep in a prison reclamation camp, a secret program is underway... one that will unlock dangerous secrets of New Eden’s past. </p> <p>It all begins with inmate 487980-A.... Templar One. Prepare for DUST 514.</p>"; 
